import React from 'react';

import classes from './Post.module.css';

const post = (props) => (
    <article className={classes.Post}
            >
        <h1>{props.title}</h1>
        <div className={classes.Info}>
            <div className="Author">{props.author}</div>
        </div>
    </article>
);

export default post;
